import React from 'react';

import manageMobileSm from "../images/portfolio/mobile/image-portfolio-manage.jpg";
import manageMobileLg from "../images/portfolio/mobile/image-portfolio-manage@2x.jpg";
import manageTabletSm from "../images/portfolio/tablet/image-portfolio-manage.jpg";
import manageTabletLg from "../images/portfolio/tablet/image-portfolio-manage@2x.jpg";
import manageDesktopSm from "../images/portfolio/desktop/image-portfolio-manage.jpg";
import manageDesktopLg from "../images/portfolio/desktop/image-portfolio-manage@2x.jpg";

function Portfolio() {
	return (
		<div className="portfolio container">

			<div className="project">
				<img
				className="project__image"
				alt="manage project example"
				src={manageMobileSm} />
			</div>
		</div>
	)
}

export default Portfolio;
